import React, { useState } from 'react';
import '../../App.css';
import '../css/HomeStyle.css';
import { Link } from 'react-router-dom';

export default function Home() {
  const [isExpanded, setIsExpanded] = useState(false);

  const handleToggle = () => {
    setIsExpanded(!isExpanded);
  };

  return (
    <div className="home">
      <div className="container">
        <h1>O Mnie</h1>
      </div>
      <div className="container">
        <h2>Moje Projekty</h2>
        <div className="article">
          <h3>Projekt1</h3>
          <img src="" alt="Upsss"></img>
          <button onClick={handleToggle}>Rozwiń/Zwiń opis</button>
          {isExpanded && <p>Opis</p>}
          <Link to="/marketing"><button>Przejdź do Marketing</button></Link>
        </div>
        <div className="article">
          <h3>Projekt2</h3>
          <img src="" alt="Upsss"></img>
          <button onClick={handleToggle}>Rozwiń/Zwiń opis</button>
          {isExpanded && <p>Opis</p>}
          <Link to="/marketing"><button>Przejdź do Marketing</button></Link>
        </div>
        <div className="article">
          <h3>Projekt3</h3>
          <img src="" alt="Upsss"></img>
          <button onClick={handleToggle}>Rozwiń/Zwiń opis</button>
          {isExpanded && <p>Opis</p>}
          <Link to="/marketing"><button>Przejdź do Marketing</button></Link>
        </div>
        <div className="article">
          <h3>Projekt4</h3>
          <img src="" alt="Upsss"></img>
          <button onClick={handleToggle}>Rozwiń/Zwiń opis</button>
          {isExpanded && <p>Opis</p>}
          <Link to="/marketing"><button>Przejdź do Marketing</button></Link>
        </div>
        <div className="article">
          <h3>Projekt5</h3>
          <img src="" alt="Upsss"></img>
          <button onClick={handleToggle}>Rozwiń/Zwiń opis</button>
          {isExpanded && <p>Opis</p>}
          <Link to="/marketing"><button>Przejdź do Marketing</button></Link>
        </div>
        <div className="article">
          <h3>Projekt6</h3>
          <img src="" alt="Upsss"></img>
          <button onClick={handleToggle}>Rozwiń/Zwiń opis</button>
          {isExpanded && <p>Opis</p>}
          <Link to="/marketing"><button>Przejdź do Marketing</button></Link>
        </div>
      </div>
    </div>
  );
}
